import {createContext } from "react";
import has from 'lodash/has'
import {cloneDeep} from "lodash";
export const StoreContext = createContext();

export  function addExpense(store,expense){
    const {expenses} = store
    if(!expense.when){
        expense.when = new Date();
    }
    const _expenses = [...expenses,expense]
    store.expenses = _expenses;
    store.expenses
    return cloneDeep(store);

}
